import {
  Grid,
  Card,
  CardContent,
  CardActions,
  Typography,
  Button
} from "@mui/material";

const Purchase = ()=>{
  const design = (
    <>
      <Grid item xs={12} sm={5}>
      <Card>
      <CardContent>
      <Typography gutterBottom variant="h5" component="div">
          Lizard
      </Typography>
      </CardContent>
      <CardActions>
      <Button size="small">Share</Button>
      </CardActions>
      </Card>
      </Grid>
    </>
  );
  return design;
}

export default Purchase;
